  vehicleUpdate.x === newTransitOrder.destX &&
  vehicleUpdate.y === newTransitOrder.destY;

if (currentStatus === "Pending" || currentStatus === "EnRoute") {
  // Conclude previous order and accept new order
  transitOrderUpdate.status = atDest ? "Arrived" : "Cancelled";
  vehicleUpdate.transitOrder = newTransitOrder.id
} else if (
  currentStatus !== "Disabled" &&
  currentStatus !== "Repair" &&
  !atDest
) {
  // Transition to new order
  vehicleUpdate.transitOrder = newTransitOrder.id
} else {
  // Keep existing order
  vehicleUpdate.transitOrder = vehicle.transitOrder.id;
}

return {
  id: vehicle.id,
  transitOrderUpdate,
  vehicleUpdate,
