const { create, all } = require("mathjs");

const { vehicle } = input;
const { transitOrder } = vehicle;

// seed the RNG for consistent simulation behavior
const config = { randomSeed: vehicle.steps };
const math = create(all, config);

const vehicleUpdate = {
  ...vehicle,
  type: vehicle.type.id,
  cargo: vehicle.cargo.map((x) => x.id),
  transitOrder: transitOrder.id,
  steps: vehicle.steps + 1,
};

const transitOrderUpdate = { ...transitOrder, status: transitOrder.status.id };

// ---

// Breakdown, accident, bad weather, ...
const disable = () => {
  const {
    reliability,
    durability,
    steps,
    lastServiceStep,
    serviceInterval,
  } = vehicleUpdate;

  const rand = math.random();

  const stepsSinceService = steps - lastServiceStep;
  const duty = Math.min(1, stepsSinceService / serviceInterval);
  const serviceNeed = 1 - (1 - durability) * duty;

  return rand > serviceNeed || rand > reliability;
};

const magnitude = (x, y) => Math.sqrt(x * x + y * y);

const normalize = (x, y) => {
  const mag = magnitude(x, y);
  return { x: x / mag, y: y / mag };
};

const move = (x, y, deltaX, deltaY, speed) => {
  const dir = normalize(deltaX, deltaY);
  const stepX = dir.x * speed;
  const stepY = dir.y * speed;
  // throw new Error(`${x}, ${y}, ${deltaX}, ${deltaY}, ${stepX}, ${stepY}, ${Math.abs(stepX) > Math.abs(deltaX)}, ${Math.abs(stepY) > Math.abs(deltaY)}`)
  return {
    x: x + (Math.abs(stepX) > Math.abs(deltaX) ? deltaX : stepX),
    y: y + (Math.abs(stepY) > Math.abs(deltaY) ? deltaY : stepY),
  };
};

// ---

const epsilon = 0.05;

if (transitOrderUpdate.status === "Pending") {
  transitOrderUpdate.status = "EnRoute";
}

if (transitOrderUpdate.status === "EnRoute") {
  transitOrderUpdate.steps = transitOrderUpdate.steps + 1;

  if (disable()) {
    transitOrderUpdate.status = "Disabled";
  } else {
    const deltaX = transitOrderUpdate.destX - vehicleUpdate.x;
    const deltaY = transitOrderUpdate.destY - vehicleUpdate.y;
    if (Math.abs(deltaX) < epsilon && Math.abs(deltaY) < epsilon) {
      vehicleUpdate.x = transitOrderUpdate.destX;
      vehicleUpdate.y = transitOrderUpdate.destY;
    } else {
      const pos = move(
        vehicleUpdate.x,
        vehicleUpdate.y,
        deltaX,
        deltaY,
        vehicle.speed
      );
      vehicleUpdate.x = pos.x;
      vehicleUpdate.y = pos.y;
    }
    if (
      vehicleUpdate.x == transitOrderUpdate.destX &&
      vehicleUpdate.y == transitOrderUpdate.destY
    ) {
      transitOrderUpdate.status = "Arrived";
    }
  }
}

return {
  id: vehicle.id,
  vehicleUpdate,
  transitOrderUpdate,
};
